import { useState, useEffect } from "react";
import "./App.css";
function App() {
  const [data, setData] = useState(null);
  useEffect(() => {
    fetch("http://localhost:8000/data")
      .then((res) => {
        return res.json();
      })
      .then((db) => {
        setData(db);
      });
  }, []);
  const items=data.advisorProfileCollection.item
  return 1;
}

export default App;
